import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import './App.css'

import Home from './components/Home';
import Workouts from './components/Workouts';
import Exercises from './components/Exercises';
import Login from './components/Login';
import Register from './components/Register';
import BackgroundVideo from './components/Backgroundvideo';
import SearchBar from './components/Searchbar';


const App = () => {

  const handleSearch = () => {
    const searchQuery = searchTerm.trim().toLowerCase();
    if (searchQuery) {
      // Make your API request here with the appropriate URL and query parameters
      fetch(`http://localhost:9292/exercises?search=${searchQuery}`)
        .then(response => response.json())
        .then(data => {
          const filteredExercises = data.results; // Adjust this based on your API response
          onSearch(filteredExercises); // Pass the filtered exercises to the parent component
        });
    }
  };

  return (
    <Router>
      <div className="App">
        <BackgroundVideo />
        <SearchBar onSearch={handleSearch}/>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/workouts" element={<Workouts />} />
          <Route path="/exercises" element={<Exercises />} />
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
